import React from 'react';
import { Layout, Menu, Button } from 'antd';
import { Link, useNavigate } from 'react-router-dom';

const { Header } = Layout;

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <Header
      style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        backgroundColor: '#004080',
      }}
    >
      <div
        style={{ color: '#fadb14', fontWeight: 'bold', fontSize: '1.5rem', cursor: 'pointer' }}
        onClick={() => navigate('/')}
      >
        FlexDetect
      </div>

      <Menu
        theme="dark"
        mode="horizontal"
        selectable={false}
        style={{ backgroundColor: '#004080' }}
      >
        <Menu.Item key="home">
          <Link to="/">Home</Link>
        </Menu.Item>
        <Menu.Item key="register">
          <Link to="/register">
            <Button
              type="primary"
              style={{
                backgroundColor: '#fadb14',
                borderColor: '#fadb14',
                color: '#004080',
              }}
            >
              Registration
            </Button>
          </Link>
        </Menu.Item>
      </Menu>
    </Header>
  );
};

export default Navbar;
